import React from 'react'

import '../css/styles.css'

const MyApp = ({ Components, pageProps }) => {
    return (
        <div>
        <div className='bg-gray-200 p-4 '>
          PalpiteBox

        </div>
      < Components  {...pageProps} />

        </div> 

    )
}

export default MyApp
